import React from 'react';

import './Copyright.scss'

const Copyright = () => {
    return (
      <footer class="bg-black small text-center text-white-50">
        <div class="container">
          Copyright &copy; YoShip Experience Delivery 2019
        </div>
      </footer>
    );
}

export default Copyright;
